import React, { useState, useEffect, useContext } from "react";
import $ from "jquery";
import Dialog from '@material-ui/core/Dialog';
import DialogTitle from '@material-ui/core/DialogTitle';
import DialogContent from '@material-ui/core/DialogContent';
import CancelIcon from '@material-ui/icons/Cancel';
import broker_banner from "../../../images/broker-banner1.jpg";
import photo2 from "../../../images/photo-2.jpg";
import photo3 from "../../../images/photo-3.jpg";
import { makeStyles } from '@material-ui/core/styles';
import Snackbar from '@material-ui/core/Snackbar';
import Backdrop from '@material-ui/core/Backdrop';
import CircularProgress from '@material-ui/core/CircularProgress';
import tours from "../../../images/tours.jpg";
import BrokerFooter from "../../../components/Footer/BrokerFooter";
import AgentHeader from "../Header/AgentHeader";
import BrokerHeader from "../Header/BrokerHeader";
import { Link, useHistory } from "react-router-dom";
import MuiAlert from '@material-ui/lab/Alert';
import Skeleton from '@material-ui/lab/Skeleton';
import { AuthContext } from "../../../CommonMethods/Authentication";
import { APIURL, APIPath } from "../../../CommonMethods/Fetch";
import { postRecord } from "../../../CommonMethods/Save";
const APIGetDashboardData = APIURL() + "agent-dashboard";
const APIBrokerDashBoard = APIURL() + "get-mycafe";
const APISaveAgentCreate = APIURL() + "agent-create";

function Alert(props) {
    return <MuiAlert elevation={6} variant="filled" {...props} />;
}
const useStyles = makeStyles((theme) => ({
    backdrop: {
        zIndex: theme.zIndex.drawer + 9999,
        color: '#fff',
    },
}));
export default function BrokerDashboard() {
    const { dispatch } = useContext(AuthContext);
    let history = useHistory();
    const context = useContext(AuthContext);
    const classes = useStyles();
    const [currentUser, setCurrentUser] = useState({});
    const [dashboardData, setDashboardData] = useState({});
    const [marketingData, setMarketingData] = useState({});
    const [marketingDataImage, SetMarketingDataImage] = useState({});
    const [mostViewed, SetMostViewed] = useState({});
    const [recentOfficeTour, SetRecentOfficeTour] = useState({});
    const [maxWidth, setMaxWidth] = React.useState('md');
    const [openCreateAgents, setOpenCreateAgents] = useState(false);
    const [agentData, setAgentData] = useState({});
    const [openSuccess, setOpenSuccess] = useState(false);
    const [message, setMessage] = useState("");
    const [sync, setSync] = useState(false);
    const [open, setOpen] = useState(false);
    const [openWarning, setOpenWarning] = useState(false);
    const [openError, setOpenError] = useState(false);
    const [inputErrors, setinputErrors] = useState({
        fname: '',
        lname: '',
        email: '',
        cnfemail: '',
        fname_error: '',
        lname_error: '',
        email_error: '',
        cnfemail_error: ''
    });
    const regex = /^(([^<>()[\]\.,;:\s@\"]+(\.[^<>()[\]\.,;:\s@\"]+)*)|(\".+\"))@(([^<>()[\]\.,;:\s@\"]+\.)+[^<>()[\]\.,;:\s@\"]{2,})$/i;
    function validateinp() {
        agentData.fname == '' || !agentData.fname ? setinputErrors(prevState => ({

            ...prevState,
            fname: 'error',
            fname_error: 'First name cannot be blank'

        })) : setinputErrors(prevState => ({

            ...prevState,
            fname: '',
            fname_error: ''


        }))
        agentData.lname == '' || !agentData.lname ? setinputErrors(prevState => ({

            ...prevState,
            lname: 'error',
            lname_error: 'Last name cannot be blank'


        })) : setinputErrors(prevState => ({

            ...prevState,
            lname: '',
            lname_error: ''


        }))
        agentData.email == '' || !agentData.email ? setinputErrors(prevState => ({

            ...prevState,
            email: 'error',
            email_error: 'E-Mail Id cannot be blank'


        })) : setinputErrors(prevState => ({

            ...prevState,
            email: '',
            email_error: ''


        }))
        agentData.cnfemail == '' || agentData.cnfemail != agentData.email || !agentData.cnfemail ? setinputErrors(prevState => ({

            ...prevState,
            cnfemail: 'error',
            cnfemail_error: 'E-Mail Confirmation does not match'


        })) : setinputErrors(prevState => ({

            ...prevState,
            cnfemail: '',
            cnfemail_error: ''


        }))
    }
    useEffect(() => {
        $(".gee_cross").hide();
        $(".gee_menu").hide();
    }, []);
    const ShowMenu = () => {
        $(".gee_menu").slideToggle("slow", function () {
            $(".gee_hamburger").hide();
            $(".gee_cross").show();
        });
    }
    const HideMenu = () => {
        $(".gee_menu").slideToggle("slow", function () {
            $(".gee_cross").hide();
            $(".gee_hamburger").show();
        });
    }
    useEffect(() => {
        if (context.state.user) {
            const objusr = { authenticate_key: "abcd123XYZ", brokerid: JSON.parse(context.state.user).user_id };
            // postRecord("https://cors-anywhere.herokuapp.com/http://139.59.28.82/vtc/api/get-mycafe", objusr)
            postRecord(APIBrokerDashBoard, objusr)
                .then(res => {
                    if (res.data[0].response.status === "success") {
                        // setDashboardData(res.data[0].response.data.agent_profile);
                        setDashboardData(res.data[0].response);
                        setMarketingData(res.data[0].response.More_Marketing_Services[0]);
                        SetMarketingDataImage(res.data[0].response.More_Marketing_Services[0]);
                        SetMostViewed(res.data[0].response.Most_Viewed[0])
                        SetRecentOfficeTour(res.data[0].response.Recent_Office_Tours[0])
                    }
                });
        }
    }, [context.state.user]);
    const handleInputChange = (event) => {
        const { name, value } = event.target;
        setAgentData({ ...agentData, [name]: value })
    }
    const handleCheckBoxChange = (event) => {
        const Check = event.target.checked === true ? 1 : 0;
        setAgentData({ ...agentData, "emailChk": Check })

    }
    const handleClose = (event, reason) => {
        if (reason === 'clickaway') {
            return;
        }
        setOpenWarning(false);
        setOpenError(false);
        setOpenSuccess(false);
    };
    // const [currentUser, setCurrentUser] = useState({});
    // const [dashboardData, setDashboardData] = useState({});
    // useEffect(() => {    
    //     if (context.state.user) {
    //         const objusr = { authenticate_key: "abcd123XYZ", agent_id: JSON.parse(context.state.user).agentId };
    //         postRecord(APIGetUserData, objusr)
    //             .then(res => {
    //                 if (res.data[0].response.status === "success") {
    //                     setCurrentUser(res.data[0].response.data.agent_profile);
    //                 }
    //             });
    //     }
    // }, [context.state.user]);
    // useEffect(() => {
    //     if (context.state.user) {
    //         const objusr = { authenticate_key: "abcd123XYZ", agent_id: JSON.parse(context.state.user).agentId };
    //         postRecord(APIGetDashboardData, objusr)      
    //             .then(res => {
    //                 if (res.data[0].response.status === "success") {
    //                     setDashboardData(res.data[0].response.data.agent_profile);
    //                 }
    //             });
    //     }
    // }, [context.state.user]);
    // console.log(agentData);
    const checkEmail = async (e) => {
        var response = '';
        response = await fetch('https://virtualtourcafe.com/alpha/admin/api/check-email',
            {
                method: "POST",
                headers: {
                    'Content-Type': 'application/json'
                },
                body: JSON.stringify({
                    authenticate_key: "abcd123XYZ",
                    email: e.target.value
                })
            }
        );
        response = await response.json();
        if (response[0].response.status == 'error') {
            setinputErrors(prevState => ({
                ...prevState,
                email: 'error',
                email_error: 'E-Mail Already Exists'
            }));

        }
        else {
            setinputErrors(prevState => ({
                ...prevState,
                email: '',
                email_error: ''
            }));
        }
    }
    const saveAgentData = () => {
        // console.log('inp errors', inputErrors);

        if (inputErrors.fname !== '' || inputErrors.lname !== '' || inputErrors.email !== '' || inputErrors.cnfemail !== '')
            return;
        // console.log('working');
        const objusr = {
            authenticate_key: "abcd123XYZ",
            brokerid: JSON.parse(context.state.user).user_id,
            fname: agentData.fname,
            lname: agentData.lname,
            email: agentData.email,
            emailChk: agentData.emailChk
        }

        postRecord(APISaveAgentCreate, objusr)
            .then(res => {
                setOpen(false);
                if (res.data[0].response.status === "success") {
                    setMessage(res.data[0].response.message);
                    setOpenSuccess(true);
                    setSync(true);
                    setOpenCreateAgents(false)
                }
                else {
                    setMessage(res.data[0].response.message);
                    setOpenError(true);
                    setSync(true);
                }
                setSync(false);
            }).catch(err => {
                setMessage("Something Went Wrong. Please try again later...");
                setOpenError(true);
                setOpen(false);
            });

    }
    const goToImageSet = () => {
        history.push(APIPath() + "broker-agent");
    }
    return (
        <div>
            {/* <AgentHeader /> */}
            <BrokerHeader />
            <section class="vtc_agent_banner" style={{ backgroundImage: "url(" + broker_banner + ")" }}>
                <div class="vtc_top_menu">
                    <div class="container-fluid">
                        <div class="row">
                            <div class="col-lg-12 col-md-12">
                                <div class="vtc_agent_menu_top">
                                    <ul>
                                        <li class="active">
                                            <Link to={APIPath() + "broker-dashboard"}>My Cafe Office</Link>
                                        </li>
                                        <li>
                                            <Link to={APIPath() + "broker-agent"}>Agents</Link>
                                        </li>
                                        <li>
                                            <Link to={APIPath() + "broker-setting"}>Settings</Link>
                                        </li>
                                        <li>
                                            <Link to={APIPath() + "broker-reports"}>Broker Reports</Link>
                                        </li>
                                        <li>
                                            <Link to={APIPath() + "broker-preferred-vendor"}>Preferred Vendors</Link>
                                        </li>

                                        <li>
                                            <Link to={APIPath() + "broker-support"}>Support</Link>
                                        </li>
                                    </ul>
                                    <div class="gee_mobile">
                                        <button onClick={() => ShowMenu()} class="gee_hamburger">&#9776;</button>
                                        <button onClick={() => HideMenu()} class="gee_cross">&#735;</button>
                                    </div>
                                </div>
                                <div class="gee_menu">
                                    <ul>
                                        <li class="">
                                            <Link to={APIPath() + "broker-dashboard"}>My Cafe Office</Link>
                                        </li>
                                        <li>
                                            <Link to={APIPath() + "broker-agent"}>Agents</Link>
                                        </li>
                                        <li>
                                            <Link to={APIPath() + "broker-setting"}>Settings</Link>
                                        </li>
                                        <li>
                                            <Link to={APIPath() + "broker-reports"}>Reports</Link>
                                        </li>
                                        <li>
                                            <Link to={APIPath() + "broker-preferred-vendor"}>Preferred Vendors</Link>
                                        </li>

                                        <li>
                                            <Link to={APIPath() + "broker-support"}>Support</Link>
                                        </li>
                                    </ul>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
                <div class="vtc_btm_menu">
                    <div class="container-fluid">
                        <div class="row">
                            <div class="col-lg-12 col-md-12">
                                <div class="vtc_btm_menu_sec">
                                    <ul>
                                        <li>Yearly - Unlimited Active Tours</li>
                                        <li>Ala-Carte - Available Credits 1 </li>
                                    </ul>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </section>

            <section class="getting_started">
                <div class="container">
                    <div class="row">
                        <div class="col-lg-12 col-md-12 mx-auto">
                            <div class="getting_started_main">
                                <div class="row">
                                    <div class="col-lg-4 col-md-4">
                                        <a href="#" data-toggle="modal" data-target="#get_start">
                                            <div class="getting_started_single">
                                                <div class="getting_started_single_img">
                                                    <i class="fas fa-paper-plane"></i>
                                                </div>
                                                <span class="no_sec">01</span>
                                                <div class="getting_started_single_cont">
                                                    <h5>Getting Started</h5>
                                                    <h6>Get Some quick Tips</h6>
                                                </div>
                                            </div>
                                        </a>
                                    </div>
                                    <div class="col-lg-4 col-md-4">
                                        <a href="javascript:void()" onClick={() => setOpenCreateAgents(true)}>
                                            <div class="getting_started_single bg_blue" id="showmenu">
                                                <div class="getting_started_single_img">
                                                    <i class="fas fa-map-marked"></i>
                                                </div>
                                                <span class="no_sec">02</span>
                                                <div class="getting_started_single_cont">
                                                    <h5>Your First Step</h5>
                                                    <h6>Create Agent</h6>
                                                </div>
                                            </div>
                                        </a>
                                    </div>
                                    <div class="col-lg-4 col-md-4">
                                        <a href="javascript:void()" onClick={goToImageSet}>
                                            <div class="getting_started_single">
                                                <div class="getting_started_single_img">
                                                    <i class="fas fa-cogs"></i>
                                                </div>
                                                <span class="no_sec">03</span>
                                                <div class="getting_started_single_cont">
                                                    <h5>Advanced Settings</h5>
                                                    <h6>MANAGE AGENTS</h6>
                                                </div>
                                            </div>
                                        </a>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </section>
            <section class="getting_started">
                <div class="container">
                    <div class="row">
                        <div class="col-lg-12 col-md-12 mx-auto">
                            <div class="getting_started_main">
                                <div class="row">
                                    <div class="col-lg-4 col-md-4">
                                        <div class="getting_started_single">
                                            {/* <div class="getting_started_single_img">
                                                <i class="far fa-hand-point-up"></i>
                                            </div> */}
                                            <span class="no_sec"></span>
                                            <div class="getting_started_single_cont">
                                                <h5>Payment Type-{Object.keys(dashboardData).length > 0 ? (
                                                    dashboardData.data.paymenttype
                                                ) : (
                                                    <Skeleton variant="text" width={150} height={20} style={{ background: "#bbbbbb" }} />
                                                )}</h5>
                                                {/* <h6>Get Some quick Tips</h6> */}
                                            </div>
                                        </div>
                                    </div>
                                    <div class="col-lg-4 col-md-4">
                                        <div class="getting_started_single bg_blue">
                                            {/* <div class="getting_started_single_img">
                                                <i class="fas fa-map-marked"></i>
                                            </div> */}
                                            <span class="no_sec"></span>
                                            <div class="getting_started_single_cont">
                                                <h5>Subscription Active - {Object.keys(dashboardData).length > 0 ? (
                                                    dashboardData.data.subscriptionactive
                                                ) : (
                                                    <Skeleton variant="text" width={150} height={20} style={{ background: "#bbbbbb" }} />
                                                )}</h5>
